import React, { useState, useEffect } from 'react';

function CabList() {
    const [cabs, setCabs] = useState([]);

    useEffect(() => {
        // Fetch available cabs from your backend
        fetch('/api/available-cabs')
            .then((response) => response.json())
            .then((data) => {
                console.log('API Response:', data); // Add this line
                setCabs(data.CabStatus); // Update to match the response structure
            })
            .catch((error) => console.error('Error fetching available cabs:', error));
    }, []);

    return (
        <div className="cab-list">
            <h2>Available Cabs</h2>
            <ul>
                {cabs.map((cab, index) => (
                    <li key={index}>
                        {cab.name} - Status: {cab.status} - Rate: {cab.rate}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default CabList;
